import React from "react";
import "../styles/Footer.css";
import SocialBar from "./SocialBar"

const Footer = () => {
  return (
    <footer className="main-footer">
        {/* ðŸ”¹ Redes Sociales */}
        <div className="social-icons">
          <a href="#" target="_blank" rel="noopener noreferrer"><FaFacebook /></a>
          <a href="#" target="_blank" rel="noopener noreferrer"><FaInstagram /></a>
          <a href="#" target="_blank" rel="noopener noreferrer"><FaLinkedin /></a>
          <a href="#" target="_blank" rel="noopener noreferrer"><FaTwitter /></a>
        </div>
        {/*Imagenes cercitifacos*/}
      <div className="certificaciones">
      <img src ="/public/images/curso.png" alt="Eneagrama"></img>
      <img src ="/public/images/logo.png" alt="logo"></img>
      <img src ="/public/images/uninversidad.png" alt="UPV"></img>
      </div>
      <p>&copy; 2025 Eneacoaching Profesional. Todos los derechos reservados.</p>
    </footer>
  );
};

export default Footer;
